import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom';
import './assets/css/Fertilizers.css';

const CustomFertilizersPage = () => {
  const history = useNavigate();

  const products = [
    {
      id: 1,
      name: 'African Blue Basil Herb',
      image: 'https://www.growjoy.com/store/pc/catalog/african_blue_basil_herb_plant_1727_thumb.jpg',
      price: '$12',
      rating: 6,
    },
    {
      id: 2,
      name: 'Lime Basil Herb',
      image: 'https://www.growjoy.com/store/pc/catalog/chives_herb_plant_2077_thumb.jpg',
      price: '$13',
      rating: 7,
    },
    {
      id: 3,
      name: 'Chive Herb',
      image: 'data:image/jpeg;base64,',
      price: '$14',
      rating: 8,
    },
    {
      id: 3,
      name: 'Succulents',
      image: 'data:image/jpeg;base64,',
      price: '$14',
      rating: 8,
    },
    {
      id: 3,
      name: 'Sunny Spots',
      image: 'data:image/jpeg;base64,',
      price: '$14',
      rating: 8,
    },
    {
      id: 3,
      name: 'Leadworts',
      image: 'data:image/jpeg;base64,',
      price: '$12',
      rating: 8.5,
    },
  ];

  const renderRatings = (rating) => {
    return rating.toFixed(1);
  };

  const handleAddToCart = (product) => {
    history(`/cart/${product.id}`); // Navigate to the CartPage with product ID in the URL
  };

  return (
    <div className="product-page-container">
      <h2 className="head">
      <Link to="/home"> <img
          className="homepage-icon"
          src="https://cdn.icon-icons.com/icons2/2248/PNG/512/home_circle_icon_137496.png"
          alt="Homepage Icon"
        /></Link>
        Plants
      </h2>
      <div className="product-grid">
        {products.map((product) => (
          <div className="product" key={product.id}>
            <img src={product.image} alt={product.name} className="product-image" />
            <p className="name">{product.name}</p>
            <p className="price">{product.price}</p>
            <p className="rating">Rating: {renderRatings(product.rating)}</p>
            <button className="add-to-cart-button" onClick={() => handleAddToCart(product)}>
              Add to Cart
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CustomFertilizersPage;
